export default class TodoApp extends React.Component {
  state = {
    inputValue: "valor inicial"
  }
  render() {
    const value = this.state.inputValue;
    return (
        <div>
          <h1>Todo App</h1>
          <input 
            value={value}
            //onChange={}
          />

          <button>Salvar</button>
        </div>
      );
  }
}
